/*查询方法*/
function find() {
    var sql = "select * from POOL";
    top.db.transaction(function (tx) {
        tx.executeSql(sql, [], function (tx, result) {
            if (result.rows.length > 0) {
                document.getElementById("u552_inputId").value = result.rows[0].id;
                document.getElementById("u552_input").value = result.rows[0].amount;
                document.getElementById("consume").innerText = result.rows[0].consume;
                document.getElementById("balance").innerText = (Number(result.rows[0].amount) - Number(result.rows[0].consume)) + "";
            }

        }, null);
    });
}

